// src/pages/Projects.jsx
import React from "react";

const projects = [
  {
    title: "Mobile App UI Design",
    description: "Create sleek wireframes and mockups for a fintech app.",
    budget: 400,
    deadline: "2025-07-28",
    client: "Techrise Innovations",
  },
  {
    title: "SEO Optimization",
    description: "Audit website and boost rankings for local bakery.",
    budget: 250,
    deadline: "2025-07-26",
    client: "Jambo Bites",
  },
  {
    title: "React Dashboard Build",
    description: "Build an analytics dashboard with charts and filters.",
    budget: 900,
    deadline: "2025-08-02",
    client: "DataTrack Kenya",
  },
];

const Projects = () => {
  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-2xl font-bold text-gray-800 mb-6">Browse Projects</h1>
      <div className="grid gap-6">
        {projects.map((proj, idx) => (
          <div key={idx} className="bg-white shadow rounded-lg p-5 hover:shadow-md transition">
            <h2 className="text-xl font-semibold text-gray-700">{proj.title}</h2>
            <p className="text-sm text-gray-600 mb-2">{proj.description}</p>
            <p className="text-sm text-gray-500">Budget: ${proj.budget} | Deadline: {proj.deadline}</p>
            <p className="text-sm text-gray-500">Client: {proj.client}</p>
            <button className="mt-4 bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700">
              Submit Proposal
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
